Science (Foundation Course),Sonipat, Narela Road,(London: Anthem Press), pp. 219-234,http://samaj.revues.org/3608,WhatsApp Misinformation and Social Science Award,Her current book project examines counterinsurgency, statemaking, and development in modern India. Drawing on archival and ethnographic research on the Jungle Mahals of West Bengal, she examines how counterinsurgency recurs as a primary driver of colonial and postcolonial statemaking in regions associated today with the Maoist insurgency. In this book, Kamra pays particular attention to the relationships between state actors and rural women that emerge in a counterinsurgency context, and how women navigate citizenship and development in rural India. This book draws on her doctoral research, and parts of it have been published in peer-reviewed journals and edited volumes.,Kamra, L (2014) The Women’s Question and Indian Maoism, in Kenneth Bo Nielsen and Anne Waldrop (eds.),,http://theasiadialogue.com/2019/03/27/women-voters-and-the-2019-indian-elections/,(New Delhi and London: Sage Publications).,Youtube,admissions.jslh@jgu.edu.in,City and Society,Grants and Fellowships,(along with Dr. Philippa Williams at Queen Mary University of London), 2018-,Biography,window.scopes_array = {};
