pnotic encounter between racially different individuals as a site for imagining complex modes of mentally relating to the racial ‘other.’ The thesis is also concerned with British and Indian authors’ representation and theorization of the psychology of reading and its relationship with socio-political identity. Bringing together a range of insights from discourses such as Victorian fiction, Postcolonial theory, theories of cosmopolitanism, affect theory, and histories of reading, the thesis makes an original intervention in the field.,( function( domain, translations ) {
